import sympy
from sympy import prime
from sympy import isprime
for n in range(1,10**5):
  s=prime(n)
  lst = []
  for i in str(s):
    lst.append(int(i))
  if isprime(s+max(lst)) and isprime(s-max(lst)):
    print(s,end=', ')
